import java.util.LinkedList;
import java.util.List;
import java.util.Stack;

public class aoc5 {

    public static void main(String[] args) {
        String input = "";

        int min = input.length();
        char charToRemove = '!';
        for (int i = 65; i <= 90; i++) {
            char lower = (char) (i+32);
            char upper = (char) (i);
            String removed = input.replace(String.valueOf(lower), "");
            removed = removed.replace(String.valueOf(upper), "");

            Stack<Character> stack = new Stack<>();
            for (char ch : removed.toCharArray()) {
                boolean isUpper = Character.isUpperCase(ch);
                if (!stack.isEmpty() && isUpper && stack.peek().equals(Character.toLowerCase(ch))) {
                    stack.pop();
                } else if (!stack.isEmpty() && stack.peek().equals(Character.toUpperCase(ch)) && !isUpper) {
                    stack.pop();
                } else {
                    stack.push(ch);
                }
            }

            if (stack.size() < min) {
                min = stack.size();
                charToRemove = lower;
            }
        }

        Stack<Character> stack = new Stack<>();
        for (char ch : input.toCharArray()) {
            boolean isUpper = Character.isUpperCase(ch);
            if (!stack.isEmpty() && isUpper && stack.peek().equals(Character.toLowerCase(ch))) {
                stack.pop();
            } else if (!stack.isEmpty() && stack.peek().equals(Character.toUpperCase(ch)) && !isUpper) {
                stack.pop();
            } else {
                stack.push(ch);
            }
        }

        System.out.println(stack.size()); // 5-1 answer = 10384
        System.out.printf("Resulting size after removing '%s%s' %d\n", charToRemove, Character.toUpperCase(charToRemove), min); // 5-2 answer = 5412
    }
}